import axios from "axios"

export const fetchSearchData = (searchText) => {
    const url = 'https://api-r1.tagalys.com/v1/search?q=men&page=1';
    const options = {
        method: 'POST',
        body: {
            '[{"key":"identification[client_code]","value":"92D5626DBFD74912","type":"text","enabled":true}]': '92D5626DBFD74912',
            'api_key': '5dff8cbc1c833937d5b6ff490de6639b',
            'store_id': 'store_id'
        }
    };

    const response = axios.request(url, options);
    console.log(response);
}
